import React from 'react';

class Home extends React.Component{
  renderPanels(){
    return(
      <div class="container">
        <div class="row">
          <div class="col-sm-4">
            Hello
          </div>
        </div>
      </div>
    );
  }

  render(){
    return(
      <div>
        {this.renderPanels()}
      </div>
    );
  };
}

export default Home;
